(10, 1, 'Sertijab 2019-2020', '<p>Webinar hari ini kita akan membahasa topik tentang dunia kerja dan kuliah, pemateri nya adalah alumni IT Club yaitu kang rival dan kang Yusuf yang insyallah ak ….</p>', 'images/article/admin-202106022120-0.jpg', 'sertijab-2019-2020', '200', '2021-06-02 14:20:48', '2021-04-11 15:33:33', '2021-06-02 14:20:48'),
(11, 1, 'Webinar Dunia Kerja&Kuliah', '<p>Webinar hari ini kita akan membahas topik tentang dunia kerja dan kuliah, pemateri nya adalah alumni IT Club yaitu kang rival dan kang Yusuf yang insyallah akan memberikan ilmu nya sebaik mungkin kepada teman-teman semua agar siap di dunia kerja dan perkuliahan agar tidak kaget pada saat lulus nanti, banyak materi yang didapatkan pada saat seminar. Seminar ini di adakan karena masih banyaknya siswa/siswi SMK yang masih bingung arah untuk menentukan pilihannya setelah lulus, apakah harus bekerja, harus berkuliah atau bahkan harus kuliah sambil kerja, mana sih pilihan terbaik yang harus diambil? agar tidak bingung maka kita datangkan para narasumber yang tentunya bisa membuat anak-anak IT Club menjadi paham mana tujuan yang harus diambil nanti ketika lulus. Kesimpulan dari seminar hari ini adalah kita boleh bekerja tapi jangan lupakan cita-cita untuk berkuliah, karena kuliah sangatlah penting untuk nanti prospek kerja, agar bisa mendapatkan jenjang karir yang lebih baik lagi, \"Investasi terbaik adalah Ilmu\".</p>', 'images/article/admin-202106022111-0.jpeg', 'webinar-dunia-kerjakuliah', '200', '2021-06-02 14:12:24', '2021-05-21 08:17:10', '2021-06-02 14:12:24'),
