(18, 1, 'Juara 2 Lomba Networking Support', '<p>Juara 2 lomba</p><p>&nbsp;</p>', 'images/article/admin-202106031142-0.jpg', 'juara-2-lomba-networking-support', '200', '2021-06-06 10:59:13', '2021-06-03 04:41:05', '2021-06-06 10:59:13'),
(19, 1, 'Ujian Kenaikan Level', NULL, 'images/article/admin-202106061647-0.jpg', 'ujian-kenaikan-level', '100', '2021-06-06 09:50:25', '2021-06-06 09:47:58', '2021-06-06 09:50:25'),
(20, 1, 'Ujian Kenaikan Level 2018', '<p>IT CLUB adalah salah satu Ekstrakurikuler yang berfokus pada bidang IT di SMK Negeri 5 Bandung yang sangat serius dalam menciptakan dan mendidik anggotanya agar bisa berada di level yang cukup untuk nanti bisa Berkuliah ataupun bersaing di dunia Kerja setelah lulus nanti di SMK Negeri 5 Bandung. Untuk meningkatkan level yang cukup maka IT CLUB memiliki sebuah tingkatan level untuk menilai kemampuan setiap anggotanya, tingkatan level itu di antaranya adalah :</p><p>Beginner adalah sebuah tingkatan level pemula yang baru mengenal IT, di level ini nanti kita akan belajar basic/dasar dari IT sesuai dengan divisi yang akan dipilih.</p><p>Intermediate adalah sebuah tingkatan level menengah bagi kalian yang lulus di level Beginner, di level ini nanti kalian akan belajar IT yang tingkatannya lebih susah dari level Beginner, contohnya nanti kalian akan belajar bagamaina caranya membuat sebuah Website untuk sebuah Startup atau E-commerce, membuat Server internet, membuat Desain Logo untuk sebuah Startup atau E-commerce, membuat Desain 3d dan masih banyak lainnya.</p><p>Expert adalah sebuah tingkatan level ahli bagi kalian yang lulus di level Intermediate, di level ini nanti kalian akan belajar IT yang tingkatannya lebih susah dari level Beginner dan Intermediate, di level ini kalian akan di fokuskan untuk siap bekerja dan berkuliah, sehingga kalian akan diberikan sebuah studi kasus yang ada di tempat kerja ataupun kuliah.</p><p>Untuk bisa lulus atau naik ke level selanjutnya maka kalian nanti akan mengikuti sebuah ujian kenaikan level di setiap semester akhir.</p>', 'images/article/admin-202106061648-0.jpg', 'ujian-kenaikan-level-2018', '200', '2021-06-06 10:59:16', '2021-06-06 09:48:56', '2021-06-06 10:59:16'),
(21, 1, 'Pembekalan Dunia Kerja dan Kuliah', '<p>Seminar hari ini kita akan membahas topik tentang dunia kerja dan kuliah, pemateri nya adalah&nbsp; alumni IT Club yaitu kang rival dan kang Yusuf yang insyallah akan memberikan ilmu nya sebaik&nbsp;mungkin kepada teman-teman semua agar siap di dunia kerja dan perkuliahan agar tidak kaget pada&nbsp; saat lulus nanti, banyak materi yang didapatkan pada saat seminar.</p><p>Seminar ini di adakan karena masih banyaknya siswa/siswi SMK yang masih bingung arah untuk&nbsp; menentukan pilihannya setelah lulus, apakah harus bekerja, harus berkuliah atau bahkan harus&nbsp; kuliah sambil kerja, mana sih pilihan terbaik yang harus diambil? agar tidak bingung maka kita&nbsp; datangkan para narasumber yang tentunya bisa membuat anak-anak IT Club menjadi paham mana&nbsp; tujuan yang harus diambil nanti ketika lulus.</p><p>Kesimpulan dari seminar hari ini adalah kita boleh bekerja tapi jangan lupakan cita-cita untuk&nbsp; berkuliah, karena kuliah sangatlah penting untuk nanti prospek kerja, agar bisa mendapatkan jenjang&nbsp; karir yang lebih baik lagi, \"Investasi terbaik adalah Ilmu\".</p>', 'images/article/admin-202106171137-0.jpeg', 'pembekalan-dunia-kerja-dan-kuliah', '200', '2021-07-08 05:08:12', '2021-06-06 11:01:39', '2021-07-08 05:08:12'),
(22, 1, 'Ujian Kenaikan Level 2018', '<p>IT CLUB adalah salah satu Ekstrakurikuler yang berfokus pada bidang IT di SMK Negeri 5 Bandung yang sangat serius dalam menciptakan dan mendidikan anggotanya agar bisa berada di level yang cukup untuk nanti bisa Berkuliah ataupun bersaing di dunia Kerja setelah lulus nanti di SMK Negeri 5 Bandung. Untuk meningkatkan level yang cukup maka IT CLUB memiliki sebuah tingkatan level untuk menilai kemampuan setiap anggotanya, tingkatan level itu di antaranya adalah :</p><p>Beginner adalah sebuah tingkatan level pemula yang baru mengenal IT, di level ini nanti kita akan belajar basic/dasar dari IT sesuai dengan divisi yang akan dipilih.</p><p>Intermediate adalah sebuah tingkatan level menengah bagi kalian yang lulus di level Beginner, di level ini nanti kalian akan belajar IT yang tingkatannya lebih susah dari level Beginner, contohnya nanti kalian akan belajar bagamaina caranya membuat sebuah Website untuk sebuah Startup atau E-commerce, membuat Server internet, membuat Desain Logo untuk sebuah Startup atau E-commerce, membuat Desain 3d dan masih banyak lainnya.</p><p>Expert adalah sebuah tingkatan level ahli bagi kalian yang lulus di level Intermediate, di level ini nanti kalian akan belajar IT yang tingkatannya lebih susah dari level Beginner dan Intermediate, di level ini kalian akan di fokuskan untuk siap bekerja dan berkuliah, sehingga kalian akan diberikan sebuah studi kasus yang ada di tempat kerja ataupun kuliah.</p><p>Untuk bisa lulus atau naik ke level selanjutnya maka kalian nanti akan mengikuti sebuah ujian kenaikan level di setiap semester akhir.</p>', 'images/article/admin-202106061802-0.jpg', 'ujian-kenaikan-level-2018', '200', NULL, '2021-06-06 11:02:41', '2021-06-06 11:03:19'),
(23, 1, 'CPD angkatan 2019-2021', '<p>CPD adalah suatu kegiatan pendidikan karakter dan kepemipinan tingkat SMK Negeri 5 Bandung yang dimulai dari, Jumat 21 Juni 2019. &nbsp;Acara yang direncanakan berlangsung selama 2 hari di hari Jumat dan Sabtu dan dibuka secara resmi oleh Wakil kepala Sekolah Bidang Kesiswaan dan pembimbing Ekstrakurikuler IT CLUB.</p><p>Di hari pertama setelah pembukaan dilanjutkan dengan kegiatan-kegiatan yang telah dibuat oleh Ekstrakurikuler IT CLUB, seperti belajar bersama, Fun Games, menonton film bersama tentang Teknologi IT untuk menambah wawasan, pelatihan pendidikan karakter, pemilihan ketua dan wakil ketua angkatan 2019-2021.&nbsp;</p><p>Dihari kedua dilanjutkan dengan olahraga/senam pagi untuk menyegarkan badan agar tidak kaku karena kegiatan panjanga dihari pertama, lalu setelah itu kita memberikan semuah pesan kepada angkatan baru untuk tetap semangat di Ekstrakurikuler IT CLUB dan kegiatan ditutup oleh Pembimbing Ekstrakurikuler IT CLUB.</p><p>Acara CPD seperti ini sangat bermanfaat untuk menumbuhkan mental dan karakter yang kuat agar nanti didalam ekskul siswa tidak merasa tertekan dengan kegiatan-kegiatan yang ada di dalam ekskul tersebut. Acara ini juga bermanfaat untuk menjalin tali silaturahmi satu sama lain atau antar angkatan sehingga pembimbing berharap acara seperti ini rutin diadakan minimal 1 tahun sekali.</p><p>&nbsp;</p>', 'images/article/admin-202106171131-0.jpg', 'cpd-angkatan-2019-2021', '200', NULL, '2021-06-17 04:31:20', '2021-06-17 04:32:49'),
(24, 1, 'Pameran Jurusan', '<p>SMK Negeri 5 bandung kembali menggelar kegiatan “Pameran Jurusan”. Pameran untuk kedua kalinya ini melibatkan 5 jurusan yaitu DPIB (Desain Pemodelan dan Informasi Bangunan), GEOMATIKA (Geodesi dan Informatika), KGSP (Konstruksi Gedung Sanitasi dan Perawatan), KA (Kimia Analisis), TKJ (Teknik Komputer Jaringan) dan PROFIL (Produksi Film).</p><p>Kegiatan ini diselenggarakan untuk semua jurusan yang ada di SMK Negeri 5 Bandung agar bisa show up hasil karya jurusan masing-masing yang bertujuan untuk memikat siswa/siswi yang ingin masuk ke SMK Negeri 5 Bandung supaya tidak bingung atau bimbang ingin masuk jurusan mana.&nbsp;</p><p>IT Club sebagai Ekstrakurikuler yang berkaitan dengan IT ditunjuk mewakili jurusan TKJ untuk memamerkan karya-karyanya seperti Games 2d, Games 3d, Website, Desain Grafis, IoT (Internet of Things) dan Desain 3d. Kegiatan berjalan dengan lancar tidak ada kendala sedikitpun, semoga di tahun selanjutnya akan ada pameran-pameran lain yang tentunya bisa lebih baik dari pada pameran yang sekarang.</p>', 'images/article/admin-202107081049-0.jpg', 'pameran-jurusan', '200', NULL, '2021-07-08 03:49:49', '2021-07-08 03:50:51'),
(25, 1, 'Seminar Desain Grafis', '<p>Sebagai Ekstrakurikuler, IT Club tentunya memerlukan upgrade/update ilmu dan wawasan untuk menunjang setiap anggotanya, sehingga kita mengadakan event atau seminar dengan mendatangkan narasumber dari pihak luar yang tentunya berpengalaman dibidangnya. &nbsp;</p><p>Sehingga kita mengadakan seminar bertema “Perkenalan Desain Grafis” sebagai narasumbernya yaitu kang Pebi Ferdiantoro yang bekerja di Tawakal Animation Studio. Banyak ilmu yang di share oleh kang Pebi, bukan hanya ilmu tentang desain tapi juga pengalaman yang harus dimiliki oleh seorang desain grafis di dunia kerja nanti seperti apa.</p><p>So buat teman-teman kami tunggu kalian di Ekstrakurikuler IT Club yah.</p>', 'images/article/admin-202107081052-0.jpg', 'seminar-desain-grafis', '200', NULL, '2021-07-08 03:52:46', '2021-07-08 04:49:53'),
(26, 1, 'Pembekalan Dunia Kerja dan Kuliah', '<p>Seminar hari ini kita akan membahas topik tentang dunia kerja dan kuliah, pemateri nya adalah&nbsp; alumni IT Club yaitu kang Rival dan kang Yusuf yang insyallah akan memberikan ilmu nya sebaik&nbsp;mungkin kepada teman-teman semua agar siap di dunia kerja dan perkuliahan agar tidak kaget pada&nbsp; saat lulus nanti, banyak materi yang didapatkan pada saat seminar.</p><p>Seminar ini di adakan karena masih banyaknya siswa/siswi SMK yang masih bingung arah untuk&nbsp; menentukan pilihannya setelah lulus, apakah harus bekerja, harus berkuliah atau bahkan harus&nbsp; kuliah sambil kerja, mana sih pilihan terbaik yang harus diambil? agar tidak bingung maka kita&nbsp; datangkan para narasumber yang tentunya bisa membuat anak-anak IT Club menjadi paham mana&nbsp; tujuan yang harus diambil nanti ketika lulus.</p><p>Kesimpulan dari seminar hari ini adalah kita boleh bekerja tapi jangan lupakan cita-cita untuk&nbsp; berkuliah, karena kuliah sangatlah penting untuk nanti prospek kerja, agar bisa mendapatkan jenjang&nbsp; karir yang lebih baik lagi, \"Investasi terbaik adalah Ilmu\".</p>', 'images/article/admin-202107081208-0.jpeg', 'pembekalan-dunia-kerja-dan-kuliah', '200', NULL, '2021-07-08 05:08:39', '2021-07-08 05:09:05'),
(27, 1, 'Juara 1 Lomba Poster Spectrum 2021', '<p>Poster adalah salah satu bentuk seni grafis dua dimensi yang didalamnya terdapat gambar dan kata-kata yang isinya memuat informasi dan biasanya ditempel di tempat-tempat umum. Suatu poster haruslah menarik pembaca sehingga poster berisikan paduan tulisan dan gambar yang indah jika dilihat. Hasil karya poster diharapkan dapat memberikan informasi, mengajak dan menghimbau banyak orang untuk melakukan sesuatu seperti apa yang digambarkan atau dituliskan pada poster tersebut terutama pada kesesuaian tema yaitu \"Kebebasan Berekspresi\".<br><br>IT CLUB menurunkan Teguh Iqbal Prayoga dari divisi Programming untuk mengikuti lomba poster spectrum 2021 ini, walaupun berasal dari divisi Programming tapi Teguh mampu memberikan hasil terbaik dengan meraih Juara 1 Tingkat Nasional Lomba Poster Spectrum 2021 di SMA Negeri 1 Godean dengan mengalahkan beberapa sekolah yang lebih di unggulkan dari pada SMK Negeri 5 Bandung. Semoga prestasi dari kang teguh ini bisa terus berlanjut ke angkatan-angkatan lainnya agar nama &nbsp;Ekstrakurikuler IT CLUB khususnya SMK Negeri 5 Bandung bisa terkenal diseluruh Indonesia.</p>', 'images/article/admin-202107161041-0.jpg', 'juara-1-lomba-poster-spectrum-2021', '200', NULL, '2021-07-16 03:40:14', '2021-07-16 03:49:56'),
(28, 1, 'Juara 1 Lomba Web Design InTech', NULL, 'images/article/admin-202107161052-0.jpg', 'juara-1-lomba-web-design-intech', '100', '2021-07-16 03:53:17', '2021-07-16 03:52:55', '2021-07-16 03:53:17'),
(29, 1, 'Juara 1 Lomba Poster InTech', '<p>InTech merupakan suatu acara perlombaan bertemakan Artificial Intelligence yang diadakan oleh Prodi Rekayasa Perangkat Lunak Institut Teknologi Telkom Surabaya guna menumbuhkan minat dan bakat para generasi muda dalam bidang AI. Pada era industri 4.0 seperti ini, banyak sistem yang telah menggunakan AI sebagai suatu sistem yang dapat mempermudah pekerjaan manusia, AI didefinisikan sebagai kecerdasan yang ditunjukkan oleh suatu entitas buatan, sistem seperti ini umumnya dimasukkan ke dalam suatu mesin (komputer) agar dapat melakukan pekerjaan seperti yang dapat dilakukan manusia. Oleh karena itu sangatlah penting untuk memperkenalkan teknologi AI agar dapat membuka wawasan generasi muda sejak dini.</p><p>Lomba InTech 2021 IT CLUB mengambil 2 bidang lomba yaitu “Web Design” dan “Poster” yang bertemakan Artificial Intelligence. Lomba Poster InTech 2021 ini IT CLUB menurunkan Aditia Fauzi dari divisi Networking dan mampu meraih Juara 1 Nasional Lomba Poster InTech 2021 dengan mengalahkan beberapa sekolah yang ada di seluruh Indonesia. Semoga prestasi dari Aditia Fauzi ini bisa terus berlanjut ke angkatan-angkatan lainnya agar nama &nbsp;Ekstrakurikuler IT CLUB khususnya SMK Negeri 5 Bandung bisa terkenal diseluruh Indonesia.</p>', 'images/article/admin-202107161106-0.jpg', 'juara-1-lomba-poster-intech', '200', NULL, '2021-07-16 03:52:55', '2021-07-16 04:06:25'),
(30, 1, 'Juara 1 Lomba Web Design InTech', '<p>InTech merupakan suatu acara perlombaan bertemakan Artificial Intelligence yang diadakan oleh Prodi Rekayasa Perangkat Lunak Institut Teknologi Telkom Surabaya guna menumbuhkan minat dan bakat para generasi muda dalam bidang AI. Pada era industri 4.0 seperti ini, banyak sistem yang telah menggunakan AI sebagai suatu sistem yang dapat mempermudah pekerjaan manusia, AI didefinisikan sebagai kecerdasan yang ditunjukkan oleh suatu entitas buatan, sistem seperti ini umumnya dimasukkan ke dalam suatu mesin (komputer) agar dapat melakukan pekerjaan seperti yang dapat dilakukan manusia. Oleh karena itu sangatlah penting untuk memperkenalkan teknologi AI agar dapat membuka wawasan generasi muda sejak dini.</p><p>Lomba InTech 2021 IT CLUB mengambil 2 bidang lomba yaitu “Web Design” dan “Poster” yang bertemakan Artificial Intelligence. Lomba Web Design ini IT CLUB menurunkan Teguh Iqbal Prayoga, Rifqi Ahmad Abiyyi dan Rian Alfazri K dari divisi Programming dan mampu meraih Juara 1 Nasional Lomba Web Design InTech 2021 dengan mengalahkan beberapa sekolah yang ada di seluruh Indonesia. Semoga prestasi dari akang-akang divisi Programming ini bisa terus berlanjut ke angkatan-angkatan lainnya agar nama &nbsp;Ekstrakurikuler IT CLUB khususnya SMK Negeri 5 Bandung bisa terkenal diseluruh Indonesia.</p>', 'images/article/admin-202107161147-0.jpg', 'juara-1-lomba-web-design-intech', '200', NULL, '2021-07-16 04:05:38', '2021-07-16 04:47:48'),
(31, 1, 'Juara 1 Lomba TechDev OlymTIK', '<p>Tech Dev OlimTIK Merupakan Kompetisi Tingkat Wilayah Jabodetabek Yang Diselenggarakan Oleh Program Studi Teknik Informatika Universitas Trilogi Bekerjasama Dengan Bisa.AI Academy. Kompetisi Ini Sebagai Sarana Untuk Menyalurkan Pengetahuan Dan Kreatifitas Siswa/Siswi SMA/SMK/MA/Sederajat Dalam Bidang Artificial Intelligence, Augmented Reality, UI/UX, Internet Of Things Dan IT Security Yang Merupakan Beberapa Diantara Teknologi Penopang Dan Entertain Di Era Revolusi Industri 4.0. Melalui Kompetisi Ini Diharapkan Mampu Meningkatkan Pengetahuan Siswa/Siswi Dalam Teknologi ITsehingga Bisa Memberi Kesiapan Dan Meningkatkan Daya Saing Masyarakat Indonesia Dalam Menghadapi Revolusi Industri 4.0.</p><p>Lomba Tech Dev OlymTIK ini IT CLUB menurunkan semua Divisi dan mampu meraih Juara 1 Nasional Lomba Tech Dev OlymTIK dan meraih 10 Peserta Terbaik dengan mengalahkan 20 Sekolah yang ada di seluruh Indonesia, ini adalah lomba Terbesar yang pernah diikuti oleh IT CLUB. Semoga prestasi dari akang-akang ini bisa terus berlanjut ke angkatan-angkatan lainnya agar nama &nbsp;Ekstrakurikuler IT CLUB khususnya SMK Negeri 5 Bandung bisa terkenal diseluruh Indonesia.</p>', 'images/article/admin-202107161122-0.jpeg', 'juara-1-lomba-techdev-olymtik', '200', NULL, '2021-07-16 04:22:32', '2021-07-16 04:34:08'),
(32, 1, 'Juara 2 Lomba Networking Support SWF', '<p>SWF (Study With Forum Asisten) adalah kegiatan belajar bersama yang diberikan Forum Asisten Universitas AMIKOM Purwokerto kepada para peserta SMK untuk menambah skill sebagai pengetahuan tambahan di bidang IT yang mungkin belum didapat di SMK. SWF 2021 hadir dengan rangkaian kegiatan workshop dan mengerjakan materi yang dilakukan secara online melalui platform Zoom dan G-MOOC.&nbsp;</p><p>IT CLUB mengikuti bidang Lomba Networking Support yang diwakilkan oleh Meylani Putri dari Divisi Networking yang mampu meraih Juara 2 tingkat Nasional Lomba Networking Support SWF dan meraih Sekolah Terbaik tingkat Nasional, sehingga Ekstrakurikuler IT CLUB SMK Negeri 5 Bandung mampu membawa pulang 2 penghargaan.&nbsp;</p><p>Semoga prestasi dari Meylani Putri ini bisa terus berlanjut ke angkatan-angkatan lainnya agar nama &nbsp;Ekstrakurikuler IT CLUB khususnya SMK Negeri 5 Bandung bisa terkenal diseluruh Indonesia.</p>', 'images/article/admin-202107161244-0.jpg', 'juara-2-lomba-networking-support-swf', '200', NULL, '2021-07-16 05:44:28', '2021-07-16 08:55:40'),
(33, 1, 'Lomba ITNSA 2021', NULL, 'images/article/admin-202107172115-0.jpeg', 'lomba-itnsa-2021', '100', '2021-07-17 14:15:45', '2021-07-17 14:15:22', '2021-07-17 14:15:45'),
(34, 1, 'Lomba ITNSA 2020', NULL, 'images/article/admin-202107172135-0.jpeg', 'lomba-itnsa-2020', '100', '2021-07-17 14:36:00', '2021-07-17 14:35:46', '2021-07-17 14:36:00'),
(35, 1, 'Juara 1 Lomba LKS IT Network System Administration 2021', '<p>SMK Negeri 5 Bandung yang di wakilkan oleh Ekstrakurikuler IT Club mengikuti Lomba IT Networking System Administration, dimana siswa terbaiknya berhasil menjuarai 1 Lomba Kompetensi Siswa (LKS) Sekolah Menengah Kejuruan (SMK) Tingkat Kota pada 27 Mei 2021 di Bandung. Rahman Fadwahudin keluar sebagai juara dan mewakili kota Bandung hingga tingkat Provinsi</p><p>Ikut bersaing diantara seluruh perwakilan sekolah yang ada di kota bandung. Alhamdulilah SMKN 5 Bandung berhasil meraih juara 1 dibidang IT Network System Administration.</p><p>Rahman Fadwahudin siswa kelas 11 SMKN 5 Bandung mengatakan perjalanan menjadi juara tingkat Kota Bandung tidaklah berjalanan mulus. Banyak rintangan yang dilalui seperti misal uji materi lomba atau modul yang berubah-ubah</p><p>Semoga prestasi dari Rahman Fadwahudin ini bisa terus berlanjut ke angkatan-angkatan lainnya agar nama &nbsp;Ekstrakurikuler IT CLUB khususnya SMK Negeri 5 Bandung bisa terkenal diseluruh Indonesia.</p><p>Harapan selalu ada bibit – bibit baru dari jurusan teknik komputer jaringan…</p>', 'images/article/admin-202107172135-0.jpeg', 'juara-1-lomba-lks-it-network-system-administration-2021', '200', NULL, '2021-07-17 14:35:50', '2021-08-09 06:12:03'),
(36, 1, 'Beasiswa Kuliah di STMIK AMIK Bandung', '<p>SMK Negeri 5 Bandung Jurusan Teknik Komputer Jaringan (TKJ) dan Produksi Film (Profil) menjalin kerja sama dengan STMIK AMIK Bandung untuk membantu para alumninya agar bisa berkuliah secara gratis tanpa biaya sepeserpun atau diberikan Beasiswa berkuliah di STMIK AMIK Bandung.</p><p>Ekstrakurikuler IT Club yang di naungi oleh Jurusan TKJ mendapatkan tempat untuk mengisi beasiswa tersebut, sehingga lulusan dari Ekstrakurikuler IT Club Alhamdulillah bisa tersalurkan berkuliah secara gratis di STMIK AMIK Bandung tanpa biaya sepeserpun.&nbsp;</p><p>IT Club mempunyai moto yaitu “Siap Kuliah Siap Kerja” sehingga lulusannya akan benar-benar disalurkan sesuai dengan minta mereka, jika berminat untuk bekerja maka akan disalurkan untuk bekerja, jika berminat untuk berkuliah, maka akan disalurkan untuk berkuliah. So buat tema-teman semua ayo buruan join dengan Ekstrakurikuler IT Club.</p>', 'images/article/admin-202107172156-0.jpeg', 'beasiswa-kuliah-di-stmik-amik-bandung', '200', NULL, '2021-07-17 14:56:25', '2021-07-19 05:37:08');
