INSERT INTO `divisions` (`id`, `name`, `content`, `image`, `slug`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Networking', 'Divisi Networking adalah salah satu divisi IT CLUB yang mempelajari materi jaringan seperti Cisco, Mikrotik, Linux, Perangkat keras dan Wireless. Buat teman-teman yang jurusan TKJ (Teknik Komputer Jaringan) wajib banget nih masuk Divisi Networking, karena akan sangat nyambung sekali nanti dengan materi yang ada di TKJ. Dalam Divisi Networking kita akan mempelajari tentang materi-materi jaringan lebih luas lagi agar kalian semua bisa lebih siap nanti di dunia kerja. Sistem belajar di Divisi Networking dibagi menjadi 2 yaitu “Pengetahuan dan Praktek”, tapi akan lebih banyak prakteknya dibandingkan dengan pengetahuannya, nah jadi nanti kalian akan diberikan sebuah studi kasus dengan deadline yang telah ditentukan. Contohnya adalah kalian akan melakukan troubleshooting dalam suatu topologi yang dimana didalam topologi tersebut terdapat masalah dan kalian harus bisa mengatasi permasalahan tersebut.<br><br>\r\nKeuntungan bergabung di Divisi Networking ialah kita bisa membuat sebuah server internet yang dimana nanti akan di implementasikan di dunia kerja. Jika masuk ke Divisi Networking kita bisa menjadi seorang IT Engineer, Networking Support, Staff Engineering, Engineer On Site dan masih banyak lainnya. Waw banyak sekali benefit yang didapatkan yah karena memang sekarang sudah Industri 4.0 yang dimana semua kegiatan hampir menggunakan teknologi, jadi profesi yang berkaitan dengan Jaringan sangat dibutuhkan sekali. So buat teman-teman yang tertarik di Networking langsung sajah join ke Divisi Networking yah.', 'images/division/u2EAu995iMSG5slQZsEqX8IXRPQl4gyOkMLh1nKF.png', 'networking', NULL, '2021-04-08 20:37:45', '2021-07-20 03:45:05'),
(2, 'Programming', 'Divisi Programming adalah suatu satu divisi IT CLUB yang mempelajari tentang ilmu pemrograman serperti HTML, CSS, PHP, Java script, Laravel, Bootstrap dan CodeIgniter. Sistem belajar di Divisi Networking dibagi menjadi 2 yaitu “Pengetahuan dan Praktek”, tapi akan lebih banyak prakteknya dibandingkan dengan pengetahuannya, nah jadi nanti kalian akan diberikan sebuah studi kasus atau project untuk diselesaikan sesuai dengan deadline yang telah ditentukan. Contoh project yang nanti akan dikerjakan adalah seperti pembuatan Website E-commerce, SIM (Sistem Informasi Manajemen) dan masih banyak lainnya. Divisi Programming akan membagi materinya menjadi 2 yaitu Frontend Developer yang berperan mengembangkan tampilan situs atau aplikasi melalui HTML, CSS dan JavaScript sedangkan Backend Developer yang berperan agar situs atau aplikasi dapat bekerja menggunakan PHP, Laravel, CodeIgniter dll. <br><br>\r\nKeuntungan bergabung di Divisi Programming ialah kita bisa membuat sebuah website yang bisa digunakan oleh banyak orang. Jika masuk ke Divisi Progamming kita bisa menjadi seorang Full stack developer, frontend developer, backend developer, IT Programmer dan masih banyak lainnya. Waw banyak sekali benefit yang didapatkan yah karena memang sekarang sudah Industri 4.0 yang dimana semua kegiatan hampir menggunakan teknologi, jadi profesi yang berkaitan dengan Pemrograman sangat dibutuhkan sekali. So buat teman-teman yang tertarik di bidang Pemrograman langsung sajah join ke Divisi Programming yah.', 'images/division/fKY8fF097HCyAfU0mNEmf5npTmqrG44CeqmeoPP3.png', 'programming', NULL, '2021-04-09 22:55:34', '2021-07-20 04:17:39'),
(7, 'Multimedia', 'Divisi Multimedia adalah salah satu divisi IT CLUB yang mempelajari materi seperti Design graphics, 3d modeling, Design character, UI/UX designer, Editting video dan masih banyak lainnya. Sistem belajar di Divisi Multimedia dibagi menjadi 2 yaitu “Pengetahuan dan Praktek”, tapi akan lebih banyak prakteknya dibandingkan dengan pengetahuannya, nah jadi nanti kalian akan diberikan sebuah studi kasus atau project untuk diselesaikan sesuai dengan deadline yang telah ditentukan. Contoh project yang nanti akan dikerjakan adalah seperti pembuatan 3d modelling untuk games, membuat UI/UX untuk kebutuhan website, membuat logo untuk kepentingan startup, editing video untuk film/iklan dan masih banyak lainnya.<br><br>\r\nKeuntungan bergabung di Divisi Multimedia adalah kita bisa menjadi seorang animator, UI/UX Designer, content creator, freelancer atau editor dan satu hal lagi, dalam mempelajari multimedia kita bisa membuka lapangan kerja sendiri. Waw banyak sekali benefit yang didapatkan yah karena memang sekarang sudah jamannya digital, jadi profesi yang berkaitan dengan Multimedia sangat dibutuhkan sekali. So buat teman-teman yang tertarik di bidang Desain, Editting Video dan Pembuatan Games langsung sajah join ke Divisi Mulmedia yah.', 'images/division/coRuju5P0NhTWlGXZ0pb9mWdIH4g3fTeEssFOHHC.png', 'multimedia', NULL, '2021-05-20 07:21:21', '2021-07-20 03:26:25');
